#!/usr/bin/python3

def fibonacci(number):
    if number == 1:
        return (0, 1)
    else:
        a, b = fibonacci(number // 2)
        c = a * (2 * b - a)
        d = b * b + a * a
        if number % 2 == 0:
            return (c, d)
        else:
            return (d, c + d)

k = int(input())
a, b = fibonacci(k + 1)
print(a, b)
